import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
import Customers from "../MyStores/MyStores";
import Contact from "../ContactUs/ContactUs";
import About from "../About/About";
import { connect } from 'react-redux'
class Home extends Component {
    componentDidMount(){
        this.props.cleanUserState();
        this.props.cleanEnterpriseState();
    }
    render() {
        console.log(this.props.user)
        return (
            <div id="wrapper">
                <div id="img" style={{ backgroundImage:`url(${"/Images/92.jpg"})`,backgroundRepeat:"no-repeat",backgroundSize:"100% 108%", height: "80vh", textAlign: "center" }}>
                    <h3 style={{ color: "white", paddingTop: "4%",fontSize:"30px",marginLeft:"60%" }}>VIRTUAL CLUB CARDS MANAGEMENT</h3>
                    <NavLink className="navLink" to="users/login" style={{ marginRight: "3vw" }}>User login</NavLink>
                    <NavLink className="navLink" to="enterprises/login">Enterprise login</NavLink>
                </div>
                <div id="about"><About></About> </div>
                <div id="stores"><Customers></Customers></div>
               <div id="contact"><Contact></Contact></div>
            </div>
        )
    }
}
const mapStateToProps = state => {
    return {
 user:state.user.user
    }
  }
const mapDispatchToProps = dispatch => {
    return {
    cleanUserState:()=>dispatch({type:"CLEAN_USER_STATE", payload: ""}),
    cleanEnterpriseState:()=>dispatch({type:"CLEAN_ENTERPRISE_STATE", payload: ""}),
    }
  }
export default connect(mapStateToProps,mapDispatchToProps)(Home);
